// Footer.js
import React from 'react';
import './Footer.css';

function Footer() {
  return (
    <footer style={{ backgroundColor: 'lightgray', padding: '10px', textAlign: 'center' }}>
      This is the footer content.
    </footer>
  );
}

export default Footer;
